A '''bird nest''' with seeds from [[Wyson]] can be obtained by trading [[mole claw]]s and [[mole skin]]s with Wyson in [[Falador Park]]. They appear identical to regular [[Bird nest (seeds)|seed nests]] obtained from [[Woodcutting]], but have a separate drop table and stack separately in the bank.

Wyson will accept noted mole claws and mole skins, and will reward [[nest box]]es if there isn't enough room in the inventory for all the nests.

