==Discontinued nests==
The [[Bird nest (Wyson, 2006-2016)|first variant]] of Wyson nests were released along with the [[Giant Mole]]. These nests originally rewarded relatively low level seeds, and were considered to not be valuable enough compared to the difficulty of the content. To improve the nests, Wyson nests were [[Update:Dragon Claws & 3rd Birthday|updated]] to a [[Bird nest (Wyson, 2016-2019)|second variant]] on [[18 February]] [[2016]] to reward more valuable seeds. The original obtained prior to this update could still exist in player banks and inventories and can be searched to provide seeds from the original reward table.

With the release of the [[Farming Guild]], the current Wyson nests were introduced. All nests previously obtained would remain in banks and inventories, and all new nests obtained can reward [[snape grass seed|snape grass]], [[dragonfruit tree seed|dragonfruit]], [[celastrus seed|celastrus]], and [[redwood tree seed]]s. This change was made to prevent players from obtaining large quantities of the new seeds immediately upon release of the content.

